def count_black_pixel_transformations(photo, filters):
    mod = 10 ** 9 - 7
    N = 10 ** 5
    p2 = [1] * (N + 1)
    for i in range(N):
        p2[i + 1] = (p2[i] << 1) % mod

    def getmask(s):
        ans = 0
        mask = 1
        for i in range(9, -1, -1):
            if s[i] == 'w' or s[i] == '+':
                ans |= mask
            mask = mask << 1
        return ans
    smask = getmask(photo)
    val = 1 << 10
    cnt = [0] * val
    for fil in filters:
        cnt[getmask(fil)] += 1
    pre = [0] * val
    pre[0] = 1
    for i in range(val):
        if cnt[i]:
            cur = [0] * val
            for j in range(val):
                cur[j] = (pre[j] + pre[i ^ j]) * p2[cnt[i] - 1] % mod
            pre = cur
    return pre[smask]

